import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Films from "./pages/Movies/Films";
import Series from "./pages/Movies/Series";
import Acceuil from "./pages/Movies/Acceuil";
import Artistes from "./pages/Movies/Artistes";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Acceuil />} />
        <Route path="/films" element={<Films />} />
        <Route path="/series" element={<Series />} />
        <Route path="/nouveautes" element={<Artistes />} />
        <Route path="*" element={<Acceuil />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
